import React from "react"

class SearchArea extends React.Component{
	render(){	
		return(
			<div className="search">
				<form action="">
					<input type="text" placeholder="Enter a book name"/>
					<button type="submit">Search</button>
				</form>
			</div>
		)
	}
}

export default SearchArea
